@lauracortese @zguigueno 

Video by @mega.beerman

Perhaps the most sentimental tune from my 2021 album is Hindsight (for 2020). I wrote it one year after the world shut down. I was feeling the weight of that year, everything we lost. But looking back through my camera roll I also found a lot of joy. This tune is my attempt to hold all of that. 

Going back through all these tunes is making me so excited for new music. Eeeee. 

@benplotnickmusic, can you make bagels again soon?

Thanks, friends, for all the early love on “For the Best.” If you haven’t heard it yet, just head to your fave streaming service (or Bandcamp!) and give it a listen ❤️

